import React from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import { Box } from '@mui/material';  // Make sure to import Box from Material UI
import Signup from './Components/Signup';
import Quiz from './Components/Quiz';
import Login from './Components/Login';
import CreateQuestion from './Components/CreateQuestion';
import AnswerQuestions from './Components/AnswerQuestions';
import LeaderboardPage from './Components/LeaderboardPage'; // Import LeaderboardPage

function App() {
  return (
    <Box
      sx={{
        backgroundImage: `url('data:image/jpeg;base64,')`, // Use the Base64 string here
        backgroundSize: 'cover',  // Ensures the image covers the entire screen
        backgroundPosition: 'center',  // Centers the image
        backgroundAttachment: 'fixed',  // Keeps the background fixed when scrolling
        height: '100vh',  // Makes sure the height takes the full viewport
        width: '100%',  // Makes sure it takes full width
        overflow: 'auto',  // Allows scrolling without cutting off the content
      }}
    >
      <Router>
        <Routes>
          <Route path="/" element={<Signup />} />
          <Route path="/login" element={<Login />} />
          <Route path="/quiz" element={<Quiz />} />
          <Route path="/create-question" element={<CreateQuestion />} />
          <Route path="/answer-questions" element={<AnswerQuestions />} /> {/* Route for answering questions */}
          <Route path="/leaderboard" element={<LeaderboardPage />} /> {/* New route for the leaderboard */}
        </Routes>
      </Router>
    </Box>
  );
}

export default App;
